-- ----------------------------
-- Procedure structure for AdCount
-- ----------------------------
DROP PROCEDURE IF EXISTS `AdCount`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `AdCount`(in starttime datetime,in endtime datetime)
begin
declare a_siteId int(11);
declare a_domain varchar(32);		-- 域名
declare a_adId int(11);		-- 广告id
declare a_referer varchar(256);		-- 引用地址
declare a_ip  int(11)  default 0;
declare a_uv  int(11)  default 0;
declare a_pv  int(11)  default 0;
declare a_eip int(11) default 0;
declare a_euv  int(11) default 0;
declare a_epv  int(11) default 0;
declare counts int default 0 ; 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare pvPro CURSOR FOR (select siteId,referer,count(referer)  as  num  from ada_collect_access_log  group by siteid,referer); -- pv 游标   where accesstime between starttime and endtime
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open pvPro;
          while flag do 
                FETCH  pvPro INTO  a_siteId,a_referer,a_pv; 
			 if flag = true then
 		   --  计算ip 数

			select count(a.remoteIp) into a_ip from  (select remoteIp  from ada_collect_access_log where siteId=a_siteId and referer=a_referer  group by remoteIp )  a  ;
		   --  计算uv 数 
			select count(a.clientId) into a_uv from  (select clientId  from ada_collect_access_log where siteId=a_siteId and referer=a_referer group by clientId )  a ;
		   --  计算 adId
			select count(id) into a_adId from ada_ad_item  where siteId=a_siteId and prefix=a_referer;
			if a_adId >0 then 
				select id into a_adId from ada_ad_item  where siteId=a_siteId and prefix=a_referer;
			end if;
		   -- 	判断 ada_day_switch_data 是否存在 当前 a_siteId
			select count(id) into counts from ada_day_switch_data  a  where  a.id  in (select id from ada_collect_access_log  where siteId=a_siteId and referer=a_referer);
			if counts >0 then 				
		   --  计算eip
			select count(b.remoteIp) into a_eip  from ( select a.remoteIp  from  ada_day_switch_data  a  where a.id in ( select id from ada_collect_access_log where siteId=a_siteId and referer=a_referer )  group by  a.remoteIp ) b;
		   --  计算 epv			
			select  count(id)  into  a_epv from ada_day_switch_data  a where a.id in ( select id from ada_collect_access_log  where siteId=a_siteId and referer=a_referer);
		   --  计算 euv 
			select count(b.clientId) into a_euv  from ( select a.clientId   from ada_day_switch_data a where a.id in (select id from ada_collect_access_log where siteId=a_siteId and referer=a_referer) group by  a.clientId ) b;
			end if;
		   --  向 ada_access_stat_day_ad    插入数据 				
	
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close pvPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for areaCount
-- ----------------------------
DROP PROCEDURE IF EXISTS `areaCount`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `areaCount`(in starttime datetime,in endtime datetime)
begin
declare a_siteId int(11);
declare a_domain varchar(32);		-- 域名
declare a_countryId int(11);		-- 国家
declare a_provinceId int(11);		-- 省

declare a_cityId int(11);			-- 城市
declare a_ip  int(11)  default 0;
declare a_uv  int(11)  default 0;
declare a_pv  int(11)  default 0;
declare a_eip int(11) default 0;
declare a_euv  int(11) default 0;
declare a_epv  int(11) default 0;
declare counts int default 0 ; 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare pvPro CURSOR FOR (select siteId,countryId,provinceId,count(siteId)  as  num  from ada_collect_access_log  group by siteid,countryId,provinceId); -- pv 游标   where accesstime between starttime and endtime
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open pvPro;
          while flag do 
                FETCH  pvPro INTO  a_siteId,a_countryId,a_provinceId,a_pv; 
			 if flag = true then
 		   --  计算ip 数

			select count(a.remoteIp) into a_ip from  (select remoteIp  from ada_collect_access_log where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId group by remoteIp )  a  ;
		   --  计算uv 数 
			select count(a.clientId) into a_uv from  (select clientId  from ada_collect_access_log where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId group by clientId )  a ;
		   -- 	判断 ada_day_switch_data 是否存在 当前 a_siteId
			select count(id) into counts from ada_day_switch_data  a  where  a.id  in (select id from ada_collect_access_log  where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId);
			if counts >0 then 				
		   --  计算eip
			select count(b.remoteIp) into a_eip  from ( select a.remoteIp  from  ada_day_switch_data  a  where a.id in ( select id from ada_collect_access_log where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId )  group by  a.remoteIp ) b;
		   --  计算 epv			
			select  count(id)  into  a_epv from ada_day_switch_data  a where a.id in ( select id from ada_collect_access_log  where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId);
		   --  计算 euv 
			select count(b.clientId) into a_euv  from ( select a.clientId   from ada_day_switch_data a where a.id in (select id from ada_collect_access_log where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId) group by  a.clientId ) b;
			end if;
		   --  向 ada_access_stat_day_area    插入数据 				
		   --  调用 ada_access_day_iparea 存储过程 地域按 IP 分类
			 call ipArea(a_siteId,a_countryId,a_provinceId,starttime,endtime);
			 call clientArea(a_siteId,a_countryId,a_provinceId,starttime,endtime);	
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close pvPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for clientArea
-- ----------------------------
DROP PROCEDURE IF EXISTS `clientArea`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `clientArea`(in a_siteId int(11),in a_countryId int(11),in a_provinceId int(11),in starttime datetime,in endtime datetime)
begin 
declare a_clientId  varchar(36)  default 0;
declare a_epv  int(11) default 0;
declare a_exceType varchar(32) default '';
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false    
declare ipPro CURSOR FOR (select clientId,count(clientId)  as  num  from  ada_collect_access_log  where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId group by  clientId ); -- ip 游标   where accesstime between starttime an     
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open ipPro;
          while flag do 
                FETCH  ipPro INTO  a_clientId,a_epv; 
			 if flag = true then
			select  exceType into a_exceType from  ada_day_switch_data  where LENGTH(exceType)=(  select max(LENGTH(exceType)) from ada_hour_switch_data where  id
				 in ( select a.id   from ada_collect_access_log  a where a.siteId=a_siteId and a.countryId=a_countryId and a.provinceId=a_provinceId and a.clientId =a_clientId ) ) limit 1;
				--  ada_access_stat_hour_ip  访问量小时统计_ip  插入数据   
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close ipPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for dayController
-- ----------------------------
DROP PROCEDURE IF EXISTS `dayController`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `dayController`(in starttime datetime,in endtime datetime)
begin
declare a_id int(11);				-- ID
declare a_siteId int(11);			-- 站点
declare a_logType int(11);			-- 日志类型1脚本日志2客户日志
declare a_requestId varchar(32) ;	-- 请求 ID
declare a_clientId varchar(36);		-- 客户端 ID	
declare a_userAgent varchar(256);	-- 用户代理
declare a_requestUrl varchar(256);	-- 请求地址
declare a_referer varchar(256);		-- 引用地址
declare a_realReferer varchar(256);	-- 真实引用
declare a_remoteIp varchar(32);		-- 远程IP
declare a_realIp varchar(32);		-- 真实IP
declare a_os varchar(16);			-- 操作系统
declare a_domain varchar(32);		-- 域名
declare a_countryId int(11);		-- 国家
declare a_provinceId int(11);		-- 省

declare a_cityId int(11);			-- 城市
declare a_accessTime date;		-- 访问时间
declare a_createTime date;			-- 创建时间
 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false  

declare highVisit CURSOR FOR ( select siteId,remoteIp  from ada_collect_access_log where referer in ( select prefix from ada_ad_item ) group by siteid,remoteIp	 
		having count(remoteIp) >=(select CONVERT(value,SIGNED)  from sys_variable where name='dayHighNum' )  ); -- 高频访问  去除非广告 ( 异常记录 的 siteID  remoteIp ) 游标 

declare changeIp CURSOR FOR (  select a.siteId,a.clientId from (select siteId,clientId,remoteIp from ada_collect_access_log  where referer in ( select prefix from ada_ad_item )  group by siteid,clientId,remoteIp)  a  group by a.siteid,a.clientId 
		having count(a.clientId)>=(select CONVERT(value,SIGNED)  from sys_variable where name='dayChangeIp')  ); -- 频繁切换  IP  去除非广告  ( 异常记录 的 siteID  clientId )   游标

declare hacksVisit CURSOR FOR (select siteId,userAgent   from ada_collect_access_log where referer in ( select prefix from ada_ad_item ) group by siteid,userAgent
		having count(userAgent)>=(select CONVERT(value,SIGNED)  from sys_variable where name='hacksVisitNum') ); --  疑是作弊软件  去除非广告 ( 异常记录 的 siteID  userAgent  )   游标 

declare accessAd CURSOR FOR (select id,siteId,clientId,remoteIp from ada_collect_access_log where referer in ( select prefix from ada_ad_item ) and realReferer is null  ); --  直接访问广告  

-- 只访问广告  找出不是访问 广告 资源的 siteId，remoteIp 分组  然后以 siteId，remoteIp  然后查询出  只访问广告的 记录
declare onlyAccessAd CURSOR FOR ( select siteId,remoteIp from ada_collect_access_log  where referer not in (select prefix from ada_ad_item ) group by siteid,remoteIp  ); --  只访问广告   where a.referer in ( select prefix from ada_ad_item ) 
--  天天 访问   同一广告 资源  连续几天 同时 访问  visitEveryDay
declare visitEveryDay CURSOR FOR (
select siteId,remoteIp,referer
	from (select siteId,remoteIp,referer,year(accessTime) qy,month(accessTime) qm,day(accessTime) qd
		from ada_collect_access_log  
			where referer in ( select prefix from ada_ad_item )   and  accessTime between ( date_sub( now(),interval ( select CONVERT(value,SIGNED)  from sys_variable where name='preDay' )  day )  )   and now()   
				group by siteid,remoteIp,referer,year(accessTime),month(accessTime),day(accessTime)  )  a  
					group by a.siteId,a.remoteIp,a.referer,a.qy,a.qm having count(a.qm) = ( select CONVERT(value,SIGNED)  from sys_variable where name='preDay' )  
);

declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- 打开高频访问 
     open highVisit;
          while flag do
                FETCH  highVisit INTO  a_siteId,a_remoteIp; 
		if flag then
		-- 将 a_siteId,a_remoteIp 条件查询 ada_collect_access_log 获得记录 插入到  ada_day_switch_data 表中	
                   call daySaveException(a_siteId,a_remoteIp,2,starttime,endtime,null);
		 COMMIT; -- 提交事务 
		end if;
          end while;
     close highVisit;
set flag=true;
	-- 打开 频繁切换IP
     open changeIp;
          while flag do
                FETCH  changeIp INTO  a_siteId,a_clientId; 
		if flag then
		-- 将 a_siteId,a_clientId 条件查询 ada_collect_access_log 获得记录 插入到  ada_day_switch_data 表中	
                   call daySaveException(a_siteId,a_clientId,3,starttime,endtime,null);
		 COMMIT; -- 提交事务 
		end if;
          end while;
     close changeIp;
set flag=true;
	-- 打开 只访问广告

     open onlyAccessAd;
          while flag do
                FETCH  onlyAccessAd INTO  a_siteId,a_remoteIp; 
		if flag then 
		-- 将 a_siteId,a_userAgent 条件查询 ada_collect_access_log 获得记录 插入到  ada_day_switch_data 表中	
                   call daySaveException(a_siteId,a_remoteIp,8,starttime,endtime,null);
		else   --  没有 访问 非广告资源的   全部访问都是 广告资源
		  call daySaveException(null,null,10,starttime,endtime,null);
		 COMMIT; -- 提交事务 
		end if;
          end while;
     close onlyAccessAd;

set flag=true;
	-- 打开 疑是作弊软件 
     open hacksVisit;
          while flag do
                FETCH  hacksVisit INTO  a_siteId,a_userAgent; 
		if flag then
		-- 将 a_siteId,a_userAgent 条件查询 ada_collect_access_log 获得记录 插入到  ada_day_switch_data 表中	
                   call daySaveException(a_siteId,a_userAgent,5,starttime,endtime,null);
		 COMMIT; -- 提交事务 
		end if;
          end while;
     close hacksVisit;
--  直接访问广告
 set flag=true;
     open accessAd;  --  打开 直接访问游标
          while flag do
                FETCH  accessAd INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_day_switch_data 是否存在
		 call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'6',starttime,endtime);
                end if;
          end while;
     close accessAd;

--  天天 访问 
 set flag=true;
     open visitEveryDay;  --  打开 直接访问游标
          while flag do
                FETCH  visitEveryDay INTO  a_siteId,a_remoteIp,a_referer; 		
                if flag = true then
		-- 将 a_siteId,a_userAgent 条件查询 ada_collect_access_log 获得记录 插入到  ada_day_switch_data 表中	
                   call daySaveException(a_siteId,a_remoteIp,1,starttime,endtime,a_referer);
                end if;
          end while;
     close visitEveryDay;
--   数据保存
		--  call dayTotal(starttime,endtime);

		call areaCount(starttime,endtime);



end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for dayExceptionWork
-- ----------------------------
DROP PROCEDURE IF EXISTS `dayExceptionWork`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `dayExceptionWork`(in a_id  int(11),in a_siteId int(11) ,in a_clientId varchar(36) ,in a_remoteIp varchar(32) ,in way varchar(11),in starttime datetime,in endtime datetime)
begin 
declare exit_data int(11) default 0;			--  ada_hour_switch_data 表中是否存在 当前数据
declare exit_excetype varchar(32) default '';
declare exit_excetype_num int(11) default 0;  --  查看是否 包含 某个 字符
declare counts int(11) default 0;
     	set exit_data=0;
        set exit_excetype='';
	set exit_excetype_num=0;
	select count(id) into counts from ada_day_switch_data where id=a_id;
		if counts >0 then 
			select id,exceType into exit_data,exit_excetype from ada_day_switch_data where id=a_id;
		end if;
			set  exit_excetype_num=find_in_set(way,exit_excetype); --  判断exit_excetype是否有该类型 异常
			if exit_data =0 then 
			elseif  exit_excetype_num=0 then 
				 update ada_day_switch_data set exceType=CONCAT(exit_excetype,way,',') where id=exit_data;
			end if;			
		COMMIT; -- 提交事务 	
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for daySaveException
-- ----------------------------
DROP PROCEDURE IF EXISTS `daySaveException`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `daySaveException`(in siteid int(11),in visit varchar(256),in way int(11),in starttime datetime,in endtime datetime,in var varchar(256))
begin
declare a_id int(11);				-- ID
declare a_siteId int(11);			-- 站点
declare a_clientId varchar(36);		-- 客户端 ID	
declare a_remoteIp varchar(32);		-- 远程IP
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare highVisit CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where referer in ( select prefix from ada_ad_item )  and a.siteId=siteid and a.remoteIp=visit); -- and  accessTime between  starttime    and   datetime
declare changeIp CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where  referer in ( select prefix from ada_ad_item )  and a.siteId=siteid and a.clientId=visit); -- and  accessTime between  starttime    and   datetime
declare hacksVisit CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where referer in ( select prefix from ada_ad_item )  and a.siteId=siteid and a.userAgent=visit); -- and  accessTime between  starttime    and   datetime
declare onlyAccessAd CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where   a.siteId=siteid and a.remoteIp<> visit  ); -- and  accessTime between  starttime    and   datetime
declare onlyAccessAdE CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a   ); -- and  accessTime between  starttime    and   datetime
declare visitEveryDay  CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where a.siteId=siteid and a.remoteIp=visit and a.referer=var   ); 
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
-- 天天访问异常 处理
if way=1 then 
     set flag=true;
     open visitEveryDay;
          while flag do
                FETCH  visitEveryDay INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_day_switch_data 是否存在
		 call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'1',starttime,endtime);
                end if;
          end while;
     close visitEveryDay;
end if;
-- 高频访问异常 处理
if way=2 then 
     set flag=true;
     open highVisit;
          while flag do
                FETCH  highVisit INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_day_switch_data 是否存在
		 call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'2',starttime,endtime);
                end if;
          end while;
     close highVisit;
end if;
--  频繁切换 IP 异常处理
if way=3 then
	set flag=true;
     open changeIp;
          while flag do
                FETCH  changeIp INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_hour_switch_data 是否存在
		 call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'3',starttime,endtime);
                end if;
          end while;
 	 close changeIp;
	end if;
--  疑是做弊软件 异常 处理
if way=5 then
	set flag=true;
     open hacksVisit;
          while flag do
                FETCH  hacksVisit INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_hour_switch_data 是否存在
		call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'5',starttime,endtime);
                end if;
          end while;
 	 close hacksVisit;
	end if;
if way=8 then
	set flag=true;
     open onlyAccessAd;
          while flag do
                FETCH  onlyAccessAd INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_hour_switch_data 是否存在
		call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'8',starttime,endtime);
                end if;
          end while;
 	 close onlyAccessAd;
	end if;
if way=10 then
	set flag=true;
     open onlyAccessAdE;
          while flag do
                FETCH  onlyAccessAdE INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_hour_switch_data 是否存在
		call dayExceptionWork( a_id,a_siteId,a_clientId,a_remoteIp,'8',starttime,endtime);
                end if;
          end while;
 	 close onlyAccessAdE;
	end if;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for dayTotal
-- ----------------------------
DROP PROCEDURE IF EXISTS `dayTotal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `dayTotal`(in starttime datetime,in endtime datetime)
begin
declare a_siteId int(11);
declare a_ip  int(11)  default 0;
declare a_uv  int(11)  default 0;
declare a_pv  int(11)  default 0;
declare a_eip int(11) default 0;
declare a_euv  int(11) default 0;
declare a_epv  int(11) default 0;
declare counts int default 0 ; 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare pvPro CURSOR FOR (select siteId,count(siteId)  as  num  from ada_collect_access_log  group by siteid); -- pv 游标   where accesstime between starttime and endtime
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open pvPro;
          while flag do 
                FETCH  pvPro INTO  a_siteId,a_pv; 
			 if flag = true then
                   -- 计算 UV 
			select count(a.clientId) num into  a_uv  from (select clientId from ada_collect_access_log where siteid=a_siteId group by clientId)  a ;
		   -- 计算 ip
			select count(a.remoteIp) num into  a_ip  from (select remoteIp from ada_collect_access_log where siteid=a_siteId group by remoteIp)  a ;
		   -- 	判断 ada_day_switch_data 是否存在 当前 a_siteId
			select count(id) into counts from ada_day_switch_data where siteid=a_siteId;
			if counts >0 then 	        
		   --  计算 epv  		
			select count(id) into a_epv  from ada_day_switch_data where siteid=a_siteId;
		   -- 计算	 eip 
			select count(a.remoteIp) num into  a_eip  from (select remoteIp from ada_day_switch_data where siteid=a_siteId group by remoteIp)  a ;
        	   --  计算 euv 
			select count(a.clientId) num into  a_euv  from (select clientId from ada_day_switch_data where siteid=a_siteId group by clientId)  a ;
			end if;
		   --  向 ada_access_total_hour    插入数据 
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close pvPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for hourClient
-- ----------------------------
DROP PROCEDURE IF EXISTS `hourClient`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `hourClient`(in starttime datetime, in endtime datetime)
begin
declare a_siteId int(11);			--   where accesstime between starttime and endtime
declare a_clientId  varchar(36)  default 0;
declare a_epv  int(11) default 0;
declare a_exceType varchar(32) default '';
declare counts int default 0 ; 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false    
declare clientPro CURSOR FOR (select siteId,clientId,count(clientId)  as  num  from ada_hour_switch_data  group by siteid,clientId); -- ip 游标   where accesstime between starttime an      
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open clientPro;
          while flag do 
                FETCH  clientPro INTO  a_siteId,a_clientId,a_epv; 
			 if flag = true then
			select  exceType into a_exceType from  ada_hour_switch_data  where LENGTH(exceType)=(  select max(LENGTH(exceType)) from ada_hour_switch_data where siteId=a_siteId and clientId=a_clientId ) limit 1;
			--  ada_access_stat_hour_client  访问量小时统计_ip  插入数据   		
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close clientPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for hourController
-- ----------------------------
DROP PROCEDURE IF EXISTS `hourController`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `hourController`(in starttime datetime,in endtime datetime)
begin
declare a_id int(11);				-- ID
declare a_siteId int(11);			-- 站点
declare a_logType int(11);			-- 日志类型1脚本日志2客户日志
declare a_requestId varchar(32) ;	-- 请求 ID
declare a_clientId varchar(36);		-- 客户端 ID	
declare a_userAgent varchar(256);	-- 用户代理
declare a_requestUrl varchar(256);	-- 请求地址
declare a_referer varchar(256);		-- 引用地址
declare a_realReferer varchar(256);	-- 真实引用
declare a_remoteIp varchar(32);		-- 远程IP
declare a_realIp varchar(32);		-- 真实IP
declare a_os varchar(16);			-- 操作系统
declare a_domain varchar(32);		-- 域名
declare a_countryId int(11);		-- 国家
declare a_provinceId int(11);		-- 省

declare a_cityId int(11);			-- 城市
declare a_accessTime date;		-- 访问时间
declare a_createTime date;			-- 创建时间
declare a_num int(11);			-- 统计次数
declare hourHighNum int(11) default 0; -- 高频访问  判断参数
declare hourChangeIp int(11) default 0;	-- 频繁切换 IP 判断参数
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare highVisit CURSOR FOR (select siteId,remoteIp,count(remoteIp)  as  num  from ada_collect_access_log group by siteid,remoteIp); -- 高频访问  游标
declare changeIp CURSOR FOR ( select a.siteId,a.clientId,count(a.clientId) num from (select siteId,clientId,remoteIp from ada_collect_access_log  group by siteid,clientId,remoteIp)  a  group by a.siteid,a.clientId); -- 频繁切换 IP 
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
select CONVERT(value,SIGNED) into hourHighNum from sys_variable where name='hourHighNum'; -- 获取小时高频访问参数
select CONVERT(value,SIGNED) into hourChangeIp from sys_variable where name='hourChangeIp'; -- 获取小时频繁切换IP参数
	-- 打开高频访问 
     open highVisit;
          while flag do
                FETCH  highVisit INTO  a_siteId,a_remoteIp,a_num; 
                if flag = true  and  a_num>=hourHighNum then
		-- 将 a_siteId,a_remoteIp 条件查询 ada_collect_access_log 获得记录 插入到  ada_hour_switch_data 表中	
                   call hourSaveException(a_siteId,a_remoteIp,1,now(),now());
		 COMMIT; -- 提交事务 
                end if;
          end while;
     close highVisit;
set flag=true;
	-- 打开 频繁切换IP
     open changeIp;
          while flag do
                FETCH  changeIp INTO  a_siteId,a_clientId,a_num; 
                if flag = true  and  a_num>=hourChangeIp then
		-- 将 a_siteId,a_clientId 条件查询 ada_collect_access_log 获得记录 插入到  ada_hour_switch_data 表中	
                   call hourSaveException(a_siteId,a_clientId,2,now(),now());
		 COMMIT; -- 提交事务 
                end if;
          end while;
     close changeIp;
--  向  ada_access_total_hour  访问量日统计 表中插入数据   调用 hourTotal 存储过程
  call hourTotal(now(),now());
  call hourIp(now(),now());
  call hourClient(now(),now());
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for hourIp
-- ----------------------------
DROP PROCEDURE IF EXISTS `hourIp`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `hourIp`(in starttime datetime,in endtime datetime)
begin
declare a_siteId int(11);			--   where accesstime between starttime and endtime
declare a_remoteIp  varchar(32)  default 0;
declare a_epv  int(11) default 0;
declare a_exceType varchar(32) default '';
declare counts int default 0 ; 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false    
declare ipPro CURSOR FOR (select siteId,remoteIp,count(siteId)  as  num  from ada_hour_switch_data  group by siteid,remoteIp); -- ip 游标   where accesstime between starttime an     
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open ipPro;
          while flag do 
                FETCH  ipPro INTO  a_siteId,a_remoteIp,a_epv; 
			 if flag = true then
			select  exceType into a_exceType from  ada_hour_switch_data  where LENGTH(exceType)=(  select max(LENGTH(exceType)) from ada_hour_switch_data where siteId=a_siteId and remoteIp=a_remoteIp ) limit 1;
				--  ada_access_stat_hour_ip  访问量小时统计_ip  插入数据   
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close ipPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for hourSaveException
-- ----------------------------
DROP PROCEDURE IF EXISTS `hourSaveException`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `hourSaveException`(in siteid int(11),in visit varchar(32),in way int(11),in starttime datetime,in endtime datetime)
begin
declare a_id int(11);				-- ID
declare a_siteId int(11);			-- 站点
declare a_clientId varchar(36);		-- 客户端 ID	
declare a_remoteIp varchar(32);		-- 远程IP
declare exit_data int(11) default 0;			--  ada_hour_switch_data 表中是否存在 当前数据
declare exit_excetype varchar(32) default '';
declare exit_excetype_num int(11) default 0;  --  查看是否 包含 某个 字符
declare counts int ;
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare highVisit CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where a.siteId=siteid and a.remoteIp=visit); -- and  accessTime between  starttime    and   datetime
declare changeIp CURSOR FOR (select a.id,a.siteId,a.clientId,a.remoteIp from ada_collect_access_log a where a.siteId=siteid and a.clientId=visit); -- and  accessTime between  starttime    and   datetime
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
-- select now() into a_startTime ;
if way=1 then 
     set flag=true;
     set exit_data=0;
     set exit_excetype='';
     set exit_excetype_num=0;
     open highVisit;
          while flag do
                FETCH  highVisit INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_hour_switch_data 是否存在
		select count(id) into counts from ada_hour_switch_data where id=a_id;
		if counts >0 then 
			select id,exceType into exit_data,exit_excetype from ada_hour_switch_data where id=a_id;
			end if;
			set  exit_excetype_num=find_in_set('2',exit_excetype);  -- 判断 exit_excetype 是否有 该类型 异常
			if exit_data =0 then 
			elseif   exit_excetype_num=0  then 
			update ada_hour_switch_data set exceType=CONCAT(exit_excetype,'2,') where id=exit_data;
			end if;			
			 COMMIT; -- 提交事务 		
                end if;
          end while;
     close highVisit;
end if;
if way=2 then
	set flag=true;
     	set exit_data=0;
        set exit_excetype='';
	set exit_excetype_num=0;
     open changeIp;
          while flag do
                FETCH  changeIp INTO  a_id,a_siteId,a_clientId,a_remoteIp; 		
                if flag = true then
		--  查看当前 id  ada_hour_switch_data 是否存在
			select count(id) into counts from ada_hour_switch_data where id=a_id;
			if counts >0 then 
			select id,exceType into exit_data,exit_excetype from ada_hour_switch_data where id=a_id;
			end if;
			set  exit_excetype_num=find_in_set('3',exit_excetype); --  判断exit_excetype是否有该类型 异常
			if exit_data =0 then 
			elseif  exit_excetype_num=0 then 
				 update ada_hour_switch_data set exceType=CONCAT(exit_excetype,'3,') where id=exit_data;
			end if;			
			 COMMIT; -- 提交事务 		
                end if;
          end while;
 	 close changeIp;
	end if;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for hourTotal
-- ----------------------------
DROP PROCEDURE IF EXISTS `hourTotal`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `hourTotal`(in starttime datetime,in endtime datetime)
begin
declare a_siteId int(11);
declare a_ip  int(11)  default 0;
declare a_uv  int(11)  default 0;
declare a_pv  int(11)  default 0;
declare a_eip int(11) default 0;
declare a_euv  int(11) default 0;
declare a_epv  int(11) default 0;
declare counts int default 0 ; 
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false 
declare pvPro CURSOR FOR (select siteId,count(siteId)  as  num  from ada_collect_access_log  group by siteid); -- pv 游标   where accesstime between starttime and endtime
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open pvPro;
          while flag do 
                FETCH  pvPro INTO  a_siteId,a_pv; 
			 if flag = true then
                   -- 计算 UV 
			select count(a.clientId) num into  a_uv  from (select clientId from ada_collect_access_log where siteid=a_siteId group by clientId)  a  ;
		   -- 计算 ip
			select count(a.remoteIp) num into  a_ip  from (select remoteIp from ada_collect_access_log where siteid=a_siteId group by remoteIp)  a ;
		   -- 	判断 ada_hour_switch_data 是否存在 当前 a_siteId
			select count(id) into counts from ada_hour_switch_data where siteid=a_siteId;
			if counts >0 then 	        
		   --  计算 epv  		
			select count(id) into a_epv  from ada_hour_switch_data where siteid=a_siteId;
		   -- 计算	 eip 
			select count(a.remoteIp) num into  a_eip  from (select remoteIp from ada_hour_switch_data where siteid=a_siteId group by remoteIp)  a ;
        	   --  计算 euv 
			select count(a.clientId) num into  a_euv  from (select clientId from ada_hour_switch_data where siteid=a_siteId group by clientId)  a ;
			end if;
		   --  向 ada_access_total_hour    插入数据 			
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close pvPro;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for ipArea
-- ----------------------------
DROP PROCEDURE IF EXISTS `ipArea`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `ipArea`(in a_siteId int(11),in a_countryId int(11),in a_provinceId int(11),in starttime datetime,in endtime datetime)
begin 
declare a_remoteIp  varchar(32)  default 0;
declare a_epv  int(11) default 0;
declare a_exceType varchar(32) default '';
declare flag boolean DEFAULT true; -- 自定义控制游标循环变量,默认false    
declare ipPro CURSOR FOR (select remoteIp,count(remoteIp)  as  num  from  ada_collect_access_log  where siteId=a_siteId and countryId=a_countryId and provinceId=a_provinceId group by  remoteIp ); -- ip 游标   where accesstime between starttime an     
declare continue handler for not found set flag = false;-- 绑定控制变量到游标,游标循环结束自动转true  
	-- pv 游标 
     open ipPro;
          while flag do 
                FETCH  ipPro INTO  a_remoteIp,a_epv; 
			 if flag = true then
			select  exceType into a_exceType from  ada_day_switch_data  where LENGTH(exceType)=(  select max(LENGTH(exceType)) from ada_hour_switch_data where  id
				 in ( select a.id   from ada_collect_access_log  a where a.siteId=a_siteId and a.countryId=a_countryId and a.provinceId=a_provinceId and a.remoteIp=a_remoteIp ) ) limit 1;
				--  ada_access_stat_hour_ip  访问量小时统计_ip  插入数据   
			end if;
		 COMMIT; -- 提交事务 
          end while;
     close ipPro;
end
;;
DELIMITER ;
